export default class TestComponent1 extends Component {
   render() {
      return (
         <div>
            <CardWithModal heheaderText='KPI_Name'>
               <LineChart />
            </CardWithModal>
            <CardWithModal className='mt-3'>
               <LineChart />
            </CardWithModal>
         </div>
      );
   }
}
